import { useState } from 'react';
import './register.css';
import { useNavigate } from 'react-router-dom';
import Header from './Header';

function Register() {
    const [userType, setUserType] = useState('artist');
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        password: '',
        confirmPassword: '',
        stageName: '',
        companyName: '',
        genre: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(formData);
    };

    const renderFormFields = () => {
        switch (userType) {
            case 'artist':
                return (
                    <>
                        <label>
                            First Name:
                            <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} />
                        </label>
                        <label>
                            Last Name:
                            <input type="text" name="lastName" value={formData.lastName} onChange={handleChange} />
                        </label>
                        <label>
                            Stage Name:
                            <input type="text" name="stageName" value={formData.stageName} onChange={handleChange} />
                        </label>
                        <label>
                            Genre:
                            <select name="genre" value={formData.genre} onChange={handleChange}>
                                <option value="">Select</option>
                                <option value="Amapiano">Amapiano</option>
                                <option value="Gospel">Gospel</option>
                                <option value="Jazz">Jazz</option>
                                <option value="Other">Other</option>
                            </select>
                        </label>
                    </>
                );
            case 'eventOrganizer':
                return (
                    <>
                        <label>
                            First Name:
                            <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} />
                        </label>
                        <label>
                            Last Name:
                            <input type="text" name="lastName" value={formData.lastName} onChange={handleChange} />
                        </label>
                        <label>
                            Company Name:
                            <input type="text" name="companyName" value={formData.companyName} onChange={handleChange} />
                        </label>
                    </>
                );
            case 'attendee':
                return (
                    <>
                        <label>
                            First Name:
                            <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} />
                        </label>
                        <label>
                            Last Name:
                            <input type="text" name="lastName" value={formData.lastName} onChange={handleChange} />
                        </label>
                    </>
                );
            default:
                return null;
        }
    };

    return (
        <div className="container">
            <div className="user-selection">
                <button onClick={() => setUserType('artist')}>Artist</button>
                <button onClick={() => setUserType('eventOrganizer')}>Event Organizer</button>
                <button onClick={() => setUserType('attendee')}>Attendee</button>
            </div>
            <form onSubmit={handleSubmit}>
                {renderFormFields()}
                <label>
                    Email:
                    <input type="email" name="email" value={formData.email} onChange={handleChange} />
                </label>
                <label>
                    Password:
                    <input type="password" name="password" value={formData.password} onChange={handleChange} />
                </label>
                <label>
                    Confirm Password:
                    <input type="password" name="confirmPassword" value={formData.confirmPassword} onChange={handleChange} />
                </label>
                <label>
                    <span>Take a picture holding your ID card for verification:</span>
                    <input type="file" />
                </label>
                <button type="submit">Submit</button>
            </form>
        </div>
    );
}
export default Register;
